import React, {Component} from 'react';

class Main extends Component {
    state={
        num:33,

        };
    render () {


            let { num } = this.state;
        return(


            <div className="main">
                Main
                <button onClick={this.props.changeCounter}> Click me</button>
                <button onClick={() => {this.props.getCode(num)}}>Clicky</button>
            </div>
        );
    }
}

export default Main;
